<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\Tenant\Domain\TenantRef;
use Civi\Lughauth\Features\Access\RelyingParty\Domain\RelyingPartyRef;
use Civi\Lughauth\Features\Access\TenantPartySecurity\Domain\ValueObject\TenantPartySecurityTenantVO;
use Civi\Lughauth\Features\Access\TenantPartySecurity\Domain\ValueObject\TenantPartySecurityRelyingPartyVO;
use Civi\Lughauth\Features\Access\TenantPartySecurity\Domain\ValueObject\TenantPartySecurityPoliciesVO;
use Civi\Lughauth\Features\Access\TenantPartySecurity\Domain\ValueObject\TenantPartySecurityVersionVO;
use Civi\Lughauth\Features\Access\TenantPartySecurity\Application\Usecase\Retrieve\TenantPartySecurityRetrieveResult;
use PHPUnit\Framework\TestCase;

final class TenantPartySecurityRetrieveResultUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new TenantPartySecurityRetrieveResult();
        $tenantOneValue = $this->getMockBuilder(TenantRef::class)->setConstructorArgs(['one'])->getMock();
        $tenantOtherValue = $this->getMockBuilder(TenantRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->tenant($tenantOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['one'])->getMock(), $value->getTenant());
        $this->assertNotEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['other'])->getMock(), $value->getTenant());
        $this->assertEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['one'])->getMock(), $value->getTenantOrDefault(TenantPartySecurityTenantVO::from($tenantOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['other'])->getMock(), $value->getTenantOrDefault(TenantPartySecurityTenantVO::from($tenantOtherValue))->value());
        $value->unsetTenant();
        $this->assertEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['other'])->getMock(), $value->getTenantOrDefault(TenantPartySecurityTenantVO::from($tenantOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(TenantRef::class)->setConstructorArgs(['one'])->getMock(), $value->getTenantOrDefault(TenantPartySecurityTenantVO::from($tenantOtherValue))->value());
        $relyingPartyOneValue = $this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['one'])->getMock();
        $relyingPartyOtherValue = $this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['other'])->getMock();
        $copy = $value->relyingParty($relyingPartyOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['one'])->getMock(), $value->getRelyingParty());
        $this->assertNotEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['other'])->getMock(), $value->getRelyingParty());
        $this->assertEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['one'])->getMock(), $value->getRelyingPartyOrDefault(TenantPartySecurityRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['other'])->getMock(), $value->getRelyingPartyOrDefault(TenantPartySecurityRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $value->unsetRelyingParty();
        $this->assertEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['other'])->getMock(), $value->getRelyingPartyOrDefault(TenantPartySecurityRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $this->assertNotEquals($this->getMockBuilder(RelyingPartyRef::class)->setConstructorArgs(['one'])->getMock(), $value->getRelyingPartyOrDefault(TenantPartySecurityRelyingPartyVO::from($relyingPartyOtherValue))->value());
        $policiesOneValue = 'one';
        $policiesOtherValue = 'other';
        $copy = $value->policies($policiesOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getPolicies());
        $this->assertNotEquals('other', $value->getPolicies());
        $this->assertEquals('one', $value->getPoliciesOrDefault(TenantPartySecurityPoliciesVO::from($policiesOtherValue))->value());
        $this->assertNotEquals('other', $value->getPoliciesOrDefault(TenantPartySecurityPoliciesVO::from($policiesOtherValue))->value());
        $value->unsetPolicies();
        $this->assertEquals('other', $value->getPoliciesOrDefault(TenantPartySecurityPoliciesVO::from($policiesOtherValue))->value());
        $this->assertNotEquals('one', $value->getPoliciesOrDefault(TenantPartySecurityPoliciesVO::from($policiesOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(TenantPartySecurityVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(TenantPartySecurityVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(TenantPartySecurityVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(TenantPartySecurityVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
